using ObjectiveC;using System;using SwiftSharp.Attributes;using System.Collections.Generic;namespace UIKit{    /// <summary>    /// A gravity behavior specifies a gravity vector that applies to all of its dynamic items.    /// </summary>    /// <see cref="https://developer.apple.com/library/prerelease/ios/documentation/UIKit/Reference/UIGravityBehavior_Class/index.html#//apple_ref/occ/cl/UIGravityBehavior"/>    [iOSVersion(7)]    public class UIGravityBehavior : UIDynamicBehavior//, AnyObject, NSObjectProtocol    {        /// <summary>        /// Adds a dynamic item to the gravity behavior’s item array.        /// </summary>        /// <param name="item">The dynamic item to add to the item array.</param>        [iOSVersion(7)]        [Export("addItem")]        public void AddItem(UIDynamicItem item) {  }                /// <summary>        /// Initializes a gravity behavior with an array of dynamic items.        /// </summary>        /// <param name="items">The dynamic items that you want to be subject to the gravity behavior.</param>        [iOSVersion(7)]        public UIGravityBehavior(AnyObject[] items) { }                /// <summary>        /// Removes a specific dynamic item from the gravity behavior.        /// </summary>        /// <param name="item">The dynamic item that you want to remove.</param>        [iOSVersion(7)]        [Export("removeItem")]        public void RemoveItem(UIDynamicItem item) {  }                /// <summary>        /// Sets the angle and magnitude of the gravity vector for the behavior.        /// </summary>        /// <param name="angle">The radian angle for the gravity vector, using standard UIKit geometry.</param>        /// <param name="magnitude">The acceleration for the gravity, with a value of 1.0 corresponding to 1000 points / second².</param>        [iOSVersion(7)]        [Export("setAngle")]        public void SetAngle(CGFloat angle, CGFloat magnitude) {  }                /// <summary>        /// Returns the set of dynamic items you’ve added to the gravity behavior. (read-only)        /// </summary>        [iOSVersion(7)]        [Export("items")]        public AnyObject[] Items { get; private set; }                /// <summary>        /// The angle, in radians, of the gravity vector for the behavior.        /// </summary>        [iOSVersion(7)]        [Export("angle")]        public CGFloat Angle { get; set; }                /// <summary>        /// The magnitude of the gravity vector for the gravity behavior.        /// </summary>        [iOSVersion(7)]        [Export("magnitude")]        public CGFloat Magnitude { get; set; }                /// <summary>        /// The direction for the gravity behavior’s gravity vector, expressed as an (x, y) pair.        /// </summary>        [iOSVersion(7)]        [Export("gravityDirection")]        public CGVector GravityDirection { get; set; }    }}